import React from "react";
import img1 from '../assets/stonks.jpg';
import '../stylesX/Investment.css';

function Investment() {
    return(
        <div id='investBody'>
            <h1 id='investTitle'>Invest in something today!</h1>
            <br/><br/>
            <img src={img1}/>
        </div>
    )
}

export default Investment;
